import React from 'react'
import CountryButton from './CountryButton'

const Sidepanel = () => {
    return (
        <div className = "sidePanel">
            <CountryButton image='https://images.twinkl.co.uk/tr/image/upload/t_illustration/illustation/guatemala-flag-black-and-white.png'/>
            <CountryButton image='https://previews.123rf.com/images/yummytime/yummytime1608/yummytime160800452/61903761-honduras-flag-icon-created-for-mobile-web-decor-print-products-applications-black-icon-isolated-on-w.jpg'/>
            <CountryButton image = 'https://yeticustomshop-designs.imgix.net/premium/austinfc/austin-fc/flat.png'/>
        </div>
    )
}


export default Sidepanel
